import React, { useEffect, useState } from 'react';
import '../styles/ViewerDashboard.css';

function ViewerDashboard() {
  const [matches, setMatches] = useState([]);
  useEffect(() => {
    fetch('http://localhost:5000/api/tournaments/scheduled-matches')
      .then((res) => res.json())
      .then((data) => {
        setMatches(data);
      })
      .catch((error) => console.error('Error fetching matches:', error));
  }, []);

  return (
    <div className="homepage">
      {/* Header Section */}
      <header className="header">
        <div className="logo">24 Score It</div>
        <nav className="navbar">
          <a href="#">Home</a>
          <a href="#">Game</a>
          <a href="#">Tournaments</a>
          <a href="#">About Us</a>
          <a href="#">Contact</a>
          <a href="#">Account</a>
        </nav>
      </header>

      {/* UBS Season Section */}
      <section className="season-section">
        <h1>UBS Season 4</h1>
        <div className="matches">
          <div className="match">
         {matches.length === 0 ? (
           <p>No matches are scheduled.</p>
         ) : (
           <ul>
             {matches.map((match, index) => {
               const matchDateTime = new Date(match.time);
               return (
                 <li key={index}>
                   {match.home_team} vs {match.away_team} on {matchDateTime.toLocaleDateString()} at {matchDateTime.toLocaleTimeString()}
                 </li>
               );
             })}
           </ul>
         )}
          </div>
        
        </div>
        <button className="view-tourney">View Tourney</button>
      </section>

      {/* Previous Tournaments Section */}
      <section className="previous-tournaments">
        <h2>Previous Tournaments</h2>
        <div className="tournament-card">
          <div className="tournament-title">United Basketball Series (UBS) Season - 3</div>
          <div className="tournament-details">
            <button>Winners</button>
            <button>Runners</button>
          </div>
        </div>
        <button className="view-more">View More</button>
      </section>

      {/* News and Updates Section */}
      <section className="news-updates">
        <h2>News and Updates</h2>
        <div className="news-card">
          <h3>The Highest Scorer of UBS Season 3 is going to retire</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit...</p>
        </div>
        <div className="news-card">
          <h3>The Highest Scorer of UBS Season 3 is going to retire</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit...</p>
        </div>
        <div className="news-card">
          <h3>The Highest Scorer of UBS Season 3 is going to retire</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit...</p>
        </div>
      </section>

      {/* Organizer Section */}
      <section className="organizer-section">
        <h2>Be the Organizer</h2>
        <button className="organize-tourney">Organize Tourney</button>
      </section>
    </div>
    // <div className="viewer">
    //   <h2>Viewer Dashboard</h2>
    //   <div>
    //     {matches.length === 0 ? (
    //       <p>No matches are scheduled.</p>
    //     ) : (
    //       <ul>
    //         {matches.map((match, index) => {
    //           const matchDateTime = new Date(match.time);
    //           return (
    //             <li key={index}>
    //               {match.home_team} vs {match.away_team} on {matchDateTime.toLocaleDateString()} at {matchDateTime.toLocaleTimeString()}
    //             </li>
    //           );
    //         })}
    //       </ul>
    //     )}
    //   </div>
    //</div>
  );
}

export default ViewerDashboard;
